import { BuildingOfficeIcon } from "@heroicons/react/20/solid";

import "./App.css";

function App() {
  return (
    <div className="fcl">
      <header className="fcl-header absolute top-0 left-0 right-0 p-2 border-b-2 border-solid border-slate-600 flex justify-between">
        <span>This is a header title</span>
        <div className="flex content-center grow-1">
          <button className="mx-4 flex grow-0 basis-20 items-center">
            <span className="w-4 mr-2 shrink-0">About</span>
          </button>
          <button className="mx-4 flex grow-0 basis-20 items-center">
            <BuildingOfficeIcon className="w-4 mr-2 shrink-0" />
            <span>Projects</span>
          </button>
          <button className="mx-4 flex grow-0 basis-20 items-center">
            <span className="w-4 mr-2 shrink-0">Contact</span>
          </button>
        </div>
      </header>
    </div>
  );
}

export default App;
